import React, { useState } from 'react';

const Kids = () => {
  const [openFilters, setOpenFilters] = useState({});

  const products = [
    {
      id: 1,
      name: "Kids Sports Shoes",
      price: 60,
      image: "https://images.unsplash.com/photo-1571019613454-1cb2f99b2d8b?w=400&h=300&fit=crop"
    },
    {
      id: 2,
      name: "Kids School Shoes",
      price: 45,
      image: "https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=400&h=300&fit=crop"
    },
    {
      id: 3,
      name: "Kids Sneakers",
      price: 55,
      image: "https://images.unsplash.com/photo-1514989940723-e8e51635b782?w=400&h=300&fit=crop"
    },
    {
      id: 4,
      name: "Kids Sandals",
      price: 35,
      image: "https://images.unsplash.com/photo-1506629905607-d405d7d3b0d2?w=400&h=300&fit=crop"
    },
    {
      id: 5,
      name: "Kids Running Shoes",
      price: 65,
      image: "https://images.unsplash.com/photo-1595461140240-75be4f9f2e11?w=400&h=300&fit=crop"
    },
    {
      id: 6,
      name: "Kids Casual Shoes",
      price: 50,
      image: "https://images.unsplash.com/photo-1603808033192-082d6919d3e1?w=400&h=300&fit=crop"
    }
  ];

  const toggleFilter = (filterName) => {
    setOpenFilters(prev => ({
      ...prev,
      [filterName]: !prev[filterName]
    }));
  };

  return (
    <div className="py-16">
      <div className="container mx-auto px-4">
        <div className="text-center mb-12">
          <h1 className="text-4xl md:text-5xl font-bold mb-4">Kids Collection</h1>
          <p className="text-lg text-secondary">Fun and comfortable shoes for kids</p>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-4 gap-8">
          <aside className="lg:col-span-1">
            <div className="bg-card p-4 rounded-lg shadow-md">
              <h3 className="text-xl font-bold mb-4">Filters</h3>

              <div className="border-b border-main pb-4 mb-4">
                <button 
                  onClick={() => toggleFilter('price')}
                  className="w-full flex justify-between items-center font-semibold"
                >
                  <span>Price</span>
                  <span>{openFilters.price ? '-' : '+'}</span>
                </button>
                {openFilters.price && (
                  <div className="mt-2">
                    <input type="range" className="w-full" min="30" max="100" />
                    <div className="flex justify-between text-sm text-secondary mt-1">
                      <span>$30</span>
                      <span>$100</span>
                    </div>
                  </div>
                )}
              </div>

              <div className="border-b border-main pb-4 mb-4">
                <button 
                  onClick={() => toggleFilter('size')}
                  className="w-full flex justify-between items-center font-semibold"
                >
                  <span>Size</span>
                  <span>{openFilters.size ? '-' : '+'}</span>
                </button>
                {openFilters.size && (
                  <div className="mt-2">
                    <div className="grid grid-cols-4 gap-2 text-center">
                      {[1, 2, 3, 4, 5, 6, 7, 8].map(size => (
                        <button key={size} className="border border-main rounded p-2 hover:bg-gray-200 dark:hover:bg-gray-700">
                          {size}
                        </button>
                      ))}
                    </div>
                  </div>
                )}
              </div>

              <div className="border-b border-main pb-4 mb-4">
                <button 
                  onClick={() => toggleFilter('type')}
                  className="w-full flex justify-between items-center font-semibold"
                >
                  <span>Type</span>
                  <span>{openFilters.type ? '-' : '+'}</span>
                </button>
                {openFilters.type && (
                  <div className="mt-2 space-y-2">
                    {['Sports Shoes', 'School Shoes', 'Sneakers', 'Sandals', 'Casual'].map(type => (
                      <label key={type} className="flex items-center space-x-2 cursor-pointer">
                        <input type="checkbox" className="h-4 w-4 rounded text-accent focus:ring-accent" />
                        <span>{type}</span>
                      </label>
                    ))}
                  </div>
                )}
              </div>

              <div className="mt-6">
                <button className="w-full bg-accent text-btn py-2 rounded-lg hover:bg-accent-hover transition-colors font-semibold">
                  Apply Filters
                </button>
              </div>
            </div>
          </aside>

          <div className="lg:col-span-3">
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8">
              {products.map(product => (
                <div key={product.id} className="bg-card rounded-lg shadow-md overflow-hidden group">
                  <img 
                    src={product.image} 
                    alt={product.name}
                    className="w-full h-64 object-cover transform group-hover:scale-105 transition-transform duration-300"
                  />
                  <div className="p-4">
                    <h3 className="font-semibold text-lg">{product.name}</h3>
                    <p className="text-secondary">${product.price}.00</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Kids;
